To create a Chrome extension that takes screenshots of a webpage and saves them to a folder on the user's computer, follow these steps:

1. Create a new folder for your extension and create the following files inside it:
   - `manifest.json`
   - `background.js`
   - `content_script.js`
   - `screenshot.html`

2. Open `manifest.json` and add the following content:

```json
{
  "manifest_version": 3,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "action": {
    "default_popup": "screenshot.html"
  },
  "permissions": [
    "activeTab",
    "storage",
    "downloads",
    "tabs",
    "http://*/*",
    "https://*/*"
  ],
  "background": {
    "service_worker": "background.js"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content_script.js"]
    }
  ],
  "icons": {
    "16": "icon16.png",
    "48": "icon48.png",
    "128": "icon128.png"
  }
}
```

Replace the `icons` array with the paths to your extension's icons.

3. Open `background.js` and add the following content:

```javascript
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.local.set({ screenshotsFolder: chrome.app.getPath("LocalAppData") + "/WebpageScreenshot" });
});

chrome.runtime.onMessageFromExtension.addListener(function(request, sender, sendResponse) {
  if (request.action === "takeScreenshot") {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var link = document.createElement("a");
      link.href = dataUrl;
      link.download = "screenshot.png";
      link.click();
    });
  }
});
```

4. Open `content_script.js` and add the following content:

```javascript
chrome.runtime.sendMessage({ action: "takeScreenshot" });
```

